import React from "react";
import {useState } from "react";

const Login = () =>{

    const [error, setError]= useState(null);

    return(
        <div>
            Login to get started!<br/><br/><br/>
            <div>
                Email<br/>
                <input type="email"/>
            </div>
            <div>
                Password<br/>
                <input type="password"/>
            </div>
            <br/>
            {
                error && <p className="error">{error}</p> 
            }
            <input type="button" value="Login"/>
        </div>
    )
}

export default Login;
